import { Link } from "react-router-dom";

function Main() {
  return (
    <Link to={"/Menu"}>
      <div className="Main">
        <div className="blue-nav">
          안 심<br />
          <div className="map">
            길찾기
            <br />
          </div>
          <img src={"/img/map.png"} alt="지도" />
          <img src={"/img/roading.png"} alt="로딩중" />
        </div>
      </div>
    </Link>
  );
}

export default Main;
